import React from "react";

export const Form = () => {
    return (
        <div className="form">
            <iframe
                title="JotForm"
                src="https://form.jotform.com/241657626760362"
                frameborder="0"
                style={{ width: "100%", height: "500px", border: "none" }}
                scrolling="yes"
            ></iframe>
        </div>
    );
}
